import React, { useState } from "react";
import './App.css';
import { Login } from "./Login/Login";
import UserProfile from './Profile/Profile'; // 确保路径正确

function App() {
  const [currentPage, setCurrentPage] = useState('login'); // 'login' 或 'profile'

  const navigateTo = (page) => {
    setCurrentPage(page);
  }

  return (
    <div className="App">
      <header>
        <button onClick={() => navigateTo('login')}>Login</button>
        <button onClick={() => navigateTo('profile')}>Profile</button>
      </header>
      <main>
        {currentPage === 'login' ? <Login /> : <UserProfile />}
      </main>
    </div>
  );
}

export default App;
